import "./PlayerCard.css";
import ButtonPlay from "./ButtonPlay";
const PlayerCard = () => {
  return (
    <div className="player-card">
      <h3>Player</h3>
      <div className="player-card__score">score: 0</div>
      <div className="player-card__buttons">
        <ButtonPlay />
        <ButtonPlay />
      </div>
    </div>
  );
};

export default PlayerCard;
